import "bootstrap/dist/css/bootstrap.min.css";
import './App.css';
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Landing from "./components/Landing";

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Route path='/' element={<Landing />} />
      </BrowserRouter>
    </div>
  );
}

export default App;
